const SIZE = 50000;
const all = $input.all().map(i => i.json);
const out = [];
for (let i = 0; i < all.length; i += SIZE) {
  out.push({ json: { vehiculos_json: all.slice(i, i + SIZE) } });
}
return out;

// ====================================
// CONSOLIDAR RESULTADOS
// ====================================

const results = $input.all();
let totalInsertados = 0;
let totalActualizados = 0;
let totalOmitidos = 0;
let totalProcesados = 0;
let errores = [];

// Procesar respuesta de cada batch
results.forEach((result, index) => {
  const data = result.json;

  if (data.success === false) {
    errores.push({
      batch: index + 1,
      error: data.error || 'Error desconocido'
    });
  } else {
    totalProcesados += data.total || 0;
    totalInsertados += data.insertados || 0;
    totalActualizados += data.actualizados || 0;
    totalOmitidos += data.omitidos || 0;
  }
});

// Generar resumen
const resumen = {
  success: errores.length === 0,
  timestamp: new Date().toISOString(),
  aseguradora: results[0]?.json?.aseguradora || 'DESCONOCIDA',
  totales: {
    procesados: totalProcesados,
    insertados: totalInsertados,
    actualizados: totalActualizados,
    omitidos: totalOmitidos
  },
  eficiencia: {
    batches_procesados: results.length,
    llamadas_http: results.length, // Solo 1 llamada por batch
    tiempo_estimado: `${Math.ceil(results.length * 2)} segundos`
  }
};

if (errores.length > 0) {
  resumen.errores = errores;
}

// Logs finales
console.log('\n' + '='.repeat(50));
console.log('‚úÖ PROCESAMIENTO COMPLETADO');
console.log('='.repeat(50));
console.log(`üìä Aseguradora: ${resumen.aseguradora}`);
console.log(`üìà Total Procesados: ${resumen.totales.procesados}`);
console.log(`   ‚ú® Nuevos insertados: ${resumen.totales.insertados}`);
console.log(`   üîÑ Actualizados: ${resumen.totales.actualizados}`);
console.log(`   ‚è≠Ô∏è  Omitidos (ya exist√≠an): ${resumen.totales.omitidos}`);
console.log(`\n‚ö° Eficiencia:`);
console.log(`   - Batches: ${resumen.eficiencia.batches_procesados}`);
console.log(`   - Llamadas HTTP: ${resumen.eficiencia.llamadas_http} (vs ${totalProcesados * 2} en versi√≥n anterior)`);
console.log(`   - Ahorro: ${((1 - (resumen.eficiencia.llamadas_http / (totalProcesados * 2))) * 100).toFixed(2)}%`);

if (errores.length > 0) {
  console.log(`\n‚ö†Ô∏è ERRORES DETECTADOS:`);
  errores.forEach(e => {
    console.log(`   - Batch ${e.batch}: ${e.error}`);
  });
}

return [{json: resumen}];

// ====================================
// NOTIFICACI√ìN OPCIONAL
// ====================================

const resumen = $json;

// Preparar mensaje de notificaci√≥n
let mensaje = `üöÄ ETL Completado - ${resumen.aseguradora}\n\n`;
mensaje += `üìä Resultados:\n`;
mensaje += `‚Ä¢ Procesados: ${resumen.totales.procesados}\n`;
mensaje += `‚Ä¢ Nuevos: ${resumen.totales.insertados}\n`;
mensaje += `‚Ä¢ Actualizados: ${resumen.totales.actualizados}\n`;
mensaje += `‚Ä¢ Omitidos: ${resumen.totales.omitidos}\n\n`;
mensaje += `‚ö° Eficiencia:\n`;
mensaje += `‚Ä¢ Llamadas HTTP: ${resumen.eficiencia.llamadas_http}\n`;
mensaje += `‚Ä¢ Tiempo: ${resumen.eficiencia.tiempo_estimado}`;

if (resumen.errores && resumen.errores.length > 0) {
  mensaje += `\n\n‚ö†Ô∏è Se detectaron ${resumen.errores.length} errores`;
}

return [{
  json: {
    mensaje: mensaje,
    resumen: resumen,
    // Aqu√≠ puedes agregar datos para enviar a Slack, email, etc.
    notificar: resumen.totales.procesados > 0
  }
}];
